# role: ethpandaops.general.goomy
goomy_user: "goomy"
goomy_datadir: "/data/goomy-txspam2"
goomy_container_name: "goomy-txspam2"
goomy_container_image: "ethpandaops/goomy-blob:blobless"
goomy_container_pull: true
goomy_container_networks: "{{ docker_networks_shared }}"
goomy_container_volumes:
  - "{{ goomy_datadir }}:/data"
goomy_rpc_urls:
  - "{% for host in groups['execution_node'] %}https://{{ secret_nginx_shared_basic_auth.name }}:{{ secret_nginx_shared_basic_auth.password }}@rpc.{{ host }}.srv.{{ network_subdomain }},{% endfor %}"
goomy_scenario: "deploytx"
goomy_extra_args: ["--max-wallets", "100", "--throughput", "2", "--max-pending", "2", "--bytecodes-file", "/data/bytecodes.txt"]
goomy_private_key: "{{ goomy_private_key2 }}"

goomy_deploy_bytecodes:
  - ""
  - ""
  - ""
  - ""
  - ""
  - ""
  - ""
